import React from "react";
import { Card } from "../../Card.styled";
import { CardInline } from "../../Card.styled2";
import { ImageCard } from "../../ImageCard.styled";
import { Button } from "../../Button.styled";
const NavBar = ({ content }) => {
  return (
    <>
      <Card
        dp={"grid"}
        gridC={"40% 35% 25%"}
        bd={"1px solid black"}
        height={"1.5rem"}
        mg={"2rem"}
      >
        <Card dp={"grid"} gridC={"auto auto auto auto"} bd={"0px solid red"}>
          <Card bd={"0px solid black"}>{content.NavBarContents[0]}</Card>
          <Card
            pd={"0.4rem 0rem"}
            ta={"center"}
            fs={"0.5rem"}
            // bd={"1px solid black"}
          >
            {content.NavBarContents[1]}
          </Card>
          <Card
            pd={"0.4rem 0rem"}
            ta={"center"}
            fs={"0.5rem"}
            // bd={"1px solid black"}
          >
            {content.NavBarContents[2]} {content.NavBarContents[3]}
          </Card>
          <Card
            pd={"0.4rem 0rem"}
            ta={"center"}
            fs={"0.5rem"}
            // bd={"1px solid black"}
          >
            {content.NavBarContents[4]}
          </Card>
        </Card>
        {/* -------------------------------------- */}
        <Card bd={"0px solid red"}></Card>
        <Card
          //   ovfy={"hidden"}
          mg={"0.2rem 0rem"}
          height={"1.1rem"}
          dp={"grid"}
          gridC={"15% 70% 15%"}
          bd={"1px solid red"}
        >
          <Card height={"inherit"} bd={"1px solid red"}>
            <ImageCard
              dp={"block"}
              mg={"auto"}
              height={"100%"}
              width={"100%"}
              src={content.NavBarContents[5]}
            />
          </Card>
          <Card height={"inherit"} bd={"0px solid red"}>
            <Button
              mg={"auto"}
              bg={"white"}
              dp={"block"}
              bd={"0.08rem solid black"}
              br={"2rem"}
              fs={"0.4rem"}
              height={"100%"}
              width={"80%"}
            >
              {content.NavBarContents[6]}
            </Button>
          </Card>
          <Card height={"inherit"} bd={"0px solid red"}>
            <ImageCard
              dp={"block"}
              mg={"auto"}
              height={"100%"}
              width={"100%"}
              src={content.NavBarContents[7]}
            />
          </Card>
        </Card>
      </Card>
    </>
  );
};

export default NavBar;
